  it('should get hourly FI prices in EUR', function (done) {
    prices.hourly({
      area: 'FI',
      endDate: '2016-04-01'
    }, function (error, response) {
      should.exist.response
      response.should.have.property('length', 24)
      response[0].should.have.property('value', 20.69)
      done()
    })
  })

  it('should get daily Oslo prices in NOK', function (done) {
    prices.daily({
      area: 'Oslo',
      currency: 'NOK',
      endDate: '2016-04-01'
    }, function (error, response) {
      should.exist.response
      response.should.have.property('length', 31)
      response[0].should.have.property('value', 207.42)
      done()
    })
  });

  it('should get weekly DK2 prices in DKK', function (done) {
    prices.weekly({
      area: 'DK2',
      currency: 'DKK',
      startDate: '2015-07-01'
    }, function (error, response) {
      should.exist.response
      response.should.have.property('length', 24)
      response[0].should.have.property('value', 162.77)
      done()
    })
  })

  it('should get monthly SE4 prices in SEK', function (done) {
    prices.monthly({
      area: 'SE4',
      currency: 'SEK',
      startDate: '2015-12-01'
    }, function (error, response) {
      should.exist.response
      response.should.have.property('length', 4)
      response[0].should.have.property('value', 207.44)
      done()
    })
  })

  it('should get all yearly prices in EUR', function (done) {
    prices.yearly({
      startDate: '2011-01-01',
      endDate: '2016-01-01'
    }, function (error, response) {
      should.exist.response
      response.should.have.property('length', 77)
      response[0].should.have.property('value', 20.98)
      done()
    })
  })

